import React, { useState } from 'react';
import './App.css';

const PredictionComponent = () => {
    const [input, setInput] = useState([0.0, 0.0, 0.0]);
    const [prediction, setPrediction] = useState(null);
    const [error, setError] = useState(null);
    const [loading, setLoading] = useState(false);

    const handleInputChange = (e, index) => {
        const newInput = [...input];
        newInput[index] = parseFloat(e.target.value);
        setInput(newInput);
    };

    const handlePredict = async () => {
        if (input.some(value => isNaN(value))) {
            setError('Please enter valid numbers for all inputs.');
            return;
        }
        setLoading(true);
        setError(null);
        try {
            const response = await fetch('http://localhost:5000/predict', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ input }),
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            const data = await response.json();
            setPrediction(data.prediction);
        } catch (err) {
            console.error('Error:', err);
            setError('An error occurred while fetching the prediction.');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="Start-container">
            <h1>AI Model Prediction</h1>
            <div className="input-container">
                {input.map((value, index) => (
                    <label key={index}>
                        Input {index + 1}:
                        <input
                            type="number"
                            value={value}
                            onChange={(e) => handleInputChange(e, index)}
                        />
                    </label>
                ))}
            </div>
            <button onClick={handlePredict} disabled={loading}>
                {loading ? 'Loading...' : 'Start'}
            </button>

            {prediction && (
                <div className="result-container">
                    <h2>Prediction Result:</h2>
                    <p>{Array.isArray(prediction) ? prediction.join(', ') : JSON.stringify(prediction)}</p>
                </div>
            )}

            {error && (
                <div className="error-container">
                    <h2>Error:</h2>
                    <p>{error}</p>
                </div>
            )}
        </div>
    );
};

export default PredictionComponent;
